class LatticeVertex4D:
    def __init__(self, xsv: int, ysv: int, zsv: int, wsv: int):
        self.xsvp = xsv * PRIME_X
        self.ysvp = ysv * PRIME_Y
        self.zsvp = zsv * PRIME_Z
        self.wsvp = wsv * PRIME_W
        ssv = (xsv + ysv + zsv + wsv) * UNSKEW_4D
        self.dx = -xsv - ssv
        self.dy = -ysv - ssv
        self.dz = -zsv - ssv
        self.dw = -wsv - ssv

lattice_vertices_by_code = [None] * 256
for i in range(256):
    cx = ((i >> 0) & 3) - 1
    cy = ((i >> 2) & 3) - 1
    cz = ((i >> 4) & 3) - 1
    cw = ((i >> 6) & 3) - 1
    lattice_vertices_by_code[i] = LatticeVertex4D(cx, cy, cz, cw)

n_lattice_vertices_total = sum(len(lookup_4d_vertex_codes[i]) for i in range(256))

LOOKUP_4D_A = [None] * 256
LOOKUP_4D_B = [None] * n_lattice_vertices_total

j = 0
for i in range(256):
    LOOKUP_4D_A[i] = (j, j + len(lookup_4d_vertex_codes[i]))
    for k in range(len(lookup_4d_vertex_codes[i])):
        LOOKUP_4D_B[j] = lattice_vertices_by_code[lookup_4d_vertex_codes[i][k]]
        j += 1
